import React, { useState } from 'react';

function Profile() {
    const [name, setName] = useState('Le Vy');
    const [degree, setDegree] = useState('Master’s degree in Information Technology');
    const [specialization, setSpecialization] = useState('Specializing in Software Development');
    const [profilePic, setProfilePic] = useState('your-image-url.jpg');

    const handleNameChange = (event) => setName(event.target.value);
    const handleDegreeChange = (event) => setDegree(event.target.value);
    const handleSpecializationChange = (event) => setSpecialization(event.target.value);
    const handleProfilePicChange = (event) => setProfilePic(event.target.value);

    return (
        <div className="profile-container">
            <div>
                <img src={profilePic} alt="Profile" className="profile-image" />
                <input type="text" value={profilePic} onChange={handleProfilePicChange} placeholder="Image URL" />
            </div>
            <div className="profile-details">
                <h1>{name}</h1>
                <p>{degree}</p>
                <p>{specialization}</p>
                <form>
                    <input type="text" value={name} onChange={handleNameChange} placeholder="Name" />
                    <input type="text" value={degree} onChange={handleDegreeChange} placeholder="Degree" />
                    <input type="text" value={specialization} onChange={handleSpecializationChange} placeholder="Specialization" />
                </form>
            </div>
        </div>
    );
}

export default Profile;
